import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';
import { Helmet } from 'react-helmet';
import './style.css';

function Home() {
    const [customers, setCustomers] = useState([]);
    const [message, setMessage] = useState('');
    const navigate = useNavigate();

    useEffect(() => {
        // No need to send the token since the session cookie is automatically sent
        axios.get('http://localhost:8081/customers', { withCredentials: true })
            .then(res => {
                setCustomers(res.data);
            })
            .catch(err => console.log(err));
    }, []);

    const handleDelete = (id) => {
        // No token required; session cookie is automatically sent
        axios.delete(`http://localhost:8081/delete-customer/${id}`, { withCredentials: true })
            .then(res => {
                setMessage('Customer deleted successfully!');
                setCustomers(customers.filter(customer => customer.id !== id));
            })
            .catch(err => {
                if (err.response && err.response.data) {
                    setMessage(err.response.data); // Display the specific error message from the server
                } else {
                    setMessage('A problem occurred.');
                }
            });
    };

    const handleLogout = () => {
        // No token required; session cookie is automatically sent
        axios.post('http://localhost:8081/logout', {}, { withCredentials: true })
            .then(() => {
                // Redirect to login page after successful logout
                navigate('/');
            }).catch(err => {
                console.error("Logout failed:", err);
                navigate('/');
            });
    };

    return (
        <div>
            <Helmet>
                <title>Home</title>
            </Helmet>

            <header>
                <h1>Communication LTD</h1>
                <div className='user-management'>
                    <div className='user-icon-container'>
                        <img src="/user-icon.png" alt="User Icon" className="user-icon" />
                        <div className="dropdown-content">
                            <Link to="/change-password">Change Password</Link>
                            <Link onClick={handleLogout}>Log Out</Link>
                        </div>
                    </div>
                </div>
            </header>

            <div className="container">
                <h2>Customers</h2>
                {message && <div className="alert alert-info">{message}</div>}
                <table className="table">
                    <thead>
                        <tr>
                            <th>ID</th>
                            <th>Name</th>
                            <th>Address</th>
                            <th></th>
                        </tr>
                    </thead>
                    <tbody>
                        {customers.map(customer => (
                            <tr key={customer.id}>
                                <td>{customer.id}</td>
                                <td>{customer.name}</td>
                                <td>{customer.address}</td>
                                <td>
                                    <button
                                        className="btn btn-danger"
                                        onClick={() => handleDelete(customer.id)}
                                    >
                                        X
                                    </button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
                <div className='center'>
                    <Link to='/add-customer' className="btn btn-primary">Add Customer</Link>
                </div>
            </div>
        </div>
    );
}

export default Home;
